import React from 'react'
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const CheckoutPayment = () => {
    const navigate = useNavigate();
    const state = useSelector((state) => state.controlItems);
    const dataShip = state.cart.shippingAddress;

    const allData = ((dataShip.fullName != null && dataShip.fullName !== '') && (dataShip.rut != null && dataShip.rut !== '') && (dataShip.addressPhone != null && dataShip.addressPhone !== '') && (dataShip.address != null && dataShip.address !== '') && (dataShip.address2 != null && dataShip.address2 !== '') && (dataShip.city != null && dataShip.city !== '') && (dataShip.region != null && dataShip.region !== '') && (dataShip.postalCode != null && dataShip.postalCode !== '') && (dataShip.additional != null && dataShip.additional !== ''))
    if (!allData) {
        console.log('falta info');
        navigate('/checkout/shipping');
    } else {
        console.log('no falta info');
    }

    const UserComplete = () => {

        return (
            <div className="container">
                <div className='col-md-7 col-lg-11 mx-auto'>
                    <h3 className='text-center'>
                        Datos personales
                    </h3>
                    <ul className="list-group mb-3">

                        <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span className='me-2'>Nombre:</span>{dataShip.fullName}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light  " >
                            <span className='me-2'>Rut: </span> {dataShip.rut}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light  " >
                            <span className='me-2'>Teléfono: </span> {dataShip.addressPhone}
                        </li>
                        <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span className='me-2'>Dirección: </span> {dataShip.address}, {dataShip.address2}, {dataShip.city}, {dataShip.region}
                        </li>
                        {dataShip.additional != null && dataShip.additional !== '' ? <li className="list-group-item d-flex justify-content-between bg-light " >
                            <span className='me-2'>Información: </span> {dataShip.additional}
                        </li> : <></>}
                    </ul>
                    <h3 className='text-center py-2'>
                        Método de pago
                    </h3>
                    <hr className='col-12 mx-auto'/>
                    <div className="row justify-content-center">
                        <div className='col-lg-4 py-2'>
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1" defaultChecked />
                                <label className="form-check-label" htmlFor="flexRadioDefault1">
                                    Transferencia
                                </label>
                            </div>
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault3" />
                                <label className="form-check-label" htmlFor="flexRadioDefault3">
                                   WebPay
                                </label>
                            </div>
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault4" />
                                <label className="form-check-label" htmlFor="flexRadioDefault4">
                                Khipu
                                </label>
                            </div>
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault4" />
                                <label className="form-check-label" htmlFor="flexRadioDefault4">
                                Paypal
                                </label>
                            </div>
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault4" />
                                <label className="form-check-label" htmlFor="flexRadioDefault4">
                                Criptomonedas
                                </label>
                            </div>
                        </div>
                        <div className="col-lg-5 d-grid gap-2 py-2">
                            <button className='btn btn-outline-primary btn-lg fw-bold'>PROCESAR ORDEN</button>
                        </div>
                    </div>

                </div>
            </div>
        );
    };

    return (
        <div>
            <UserComplete />
        </div>
    )
}

export default CheckoutPayment
